import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../PageTemplate.css';

const Register = () => {
  const navigate = useNavigate();

  return (
    <div className="page-template">
      <div className="page-header">
        <button className="back-button" onClick={() => navigate('/')}>
          ‚Üê Back to Home
        </button>
        <h1>Register</h1>
      </div>
      <div className="page-content">
        <div className="placeholder-content">
          <h2>üõí Register System</h2>
          <p>Point of Sale register functionality will be implemented here.</p>
          <div className="feature-list">
            <button className="action-button" onClick={() => navigate('/POScart')}>üí∞ Process Sales transactions</button>
            <div className="feature-item">‚Ä¢ Order Report</div>
            <div className="feature-item">‚Ä¢ Print receipts</div>
            <div className="feature-item">‚Ä¢ Manage returns and refunds</div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Register;
